	<style>
	body{
		font: 62.5% "Trebuchet MS", sans-serif;
		margin: 50px;
	}
	.demoHeaders {
		margin-top: 2em;
	}
	#dialog-link {
		padding: .4em 1em .4em 20px;
		text-decoration: none;
		position: relative;
	}
	#dialog-link span.ui-icon {
		margin: 0 5px 0 0;
		position: absolute;
		left: .2em;
		top: 50%;
		margin-top: -8px;
	}
	#icons {
		margin: 0;
		padding: 0;
	}
	#icons li {
		margin: 2px;
		position: relative;
		padding: 4px 0;
		cursor: pointer;
		float: left;
		list-style: none;
	}
	#icons span.ui-icon {
		float: left;
		margin: 0 4px;
	}
	.fakewindowcontain .ui-widget-overlay {
		position: absolute;
	}
    
    .terrain_coast {
        background-color: aqua;
    }

    .terrain_ocean {
        background-color: #70B8FF;
    }
    
   .terrain_plains {
        background-color: #EAE8D0;
    }
    
   .terrain_grass {
        background-color: #9FDB9F;
    }

   .terrain_tundra {
        background-color: #BABABA;
    }
    
   .terrain_desert {
        background-color: #FFF9E0;
    }
    
   .terrain_peak {
        background-color: brown;
    }
    
    .hill {
        background-image: url("doc/icons/hill.png");
    }
    
    .jungle {
        background-image: url("doc/icons/jungle.png");
    }
    
    .junglehill {
        background-image: url("doc/icons/junglehill.png");
    }
    
    .forest {
        background-image: url("doc/icons/forest.png");
    }
    
    .foresthill {
        background-image: url("doc/icons/foresthill.png");
    }
    
    table {
        border-spacing: 0px !important;
    }
    
    img {
        border: 0px;
    }
    
    td.div {
        padding: 0px;
        border: 0px;
        margin: 0px;
        font-size: 0px;
    }
    
    td {
        background-color: blue;
        border: 0px;
        margin: 0px;
        padding: 0px;
        width: 19px;
        height: 19px;
        font-size: 0px;
    }
    
    .isNOfRiver {
        height: 18px !important;
        margin-bottom: 1px;
        background-position-y: -1px;
    }
    
    
    .isWOfRiver {
        height: 18px !important;
        margin-bottom: 1px;
        background-position-x: -1px;
    }

	</style>
